class Solution:
    def maximumSum1(self, arr) -> int:

        left = 0
        res = float("-inf")
        cur_max = 0
        n = len(arr)
        flag = 0
        for i in range(n):
            if arr[i] < 0:
                flag += 1
            while left < n and flag >= 2:
                if arr[left] < 0:
                    flag -= 1
                if arr[left] >= 0:
                    cur_max -= arr[left]
                left += 1
            if arr[i] >= 0:
                cur_max += arr[i]
                res = max(res, cur_max)
        return res if res != float("-inf") else max(arr)

    def maximumSum2(self, arr) -> int:
        n = len(arr)
        res = float("-inf")
        for i in range(n):
            for j in range(i):
                all_sum = sum(arr[j:i + 1])
                min_num = min(arr[j:i + 1])
                if min_num < 0:
                    res = max(res, all_sum - min_num)
                else:
                    res = max(res, all_sum)
        return res if res != float("-inf") else max(arr)

    def maximumSum(self, arr) -> int:
        n = len(arr)
        left_max = [0] * n
        right_max = [0] * n
        res = max(arr[0], arr[-1])
        left_max[0] = arr[0]
        for i in range(1, n):
            left_max[i] = arr[i]
            if left_max[i - 1] > 0:
                left_max[i] += left_max[i -1]
            res = max(res,left_max[i])
        right_max[-1] = arr[-1]
        for i in range(n - 2, -1, -1):
            right_max[i] = arr[i]
            if right_max[i + 1] > 0:
                right_max[i] += right_max[i + 1]
            res = max(res, right_max[i])

        for i in range(1, n - 1):
            res = max(left_max[i - 1] + right_max[i + 1], res)
        return res


